import React from 'react';
import './App.css';
import RickAndMortyCharacterCard from './Styles';

function App() {
  return (
    <div className="App">
      <h1>Rick and Morty Characters</h1>
      <div className="character-container">
        {}
        <RickAndMortyCharacterCard />
      </div>
    </div>
  );
}

export default App;
